import React from 'react';
import UserForm from './UserForm';
import UserTable from './UserTable';

const App = () => {
  return (
    <div>
      <div>
        <UserForm />
      </div>
      <div>
        <UserTable />
      </div>
    </div>
  );
};

export default App;
